  return (  
    <nav className="bg-gray-800 p-4">  
      <div className="max-w-4xl mx-auto flex flex-col items-center">  
        <h1 className="text-white">Navbar Test</h1>  
      </div>  
    </nav>  
  );  
}  
  
export default Navbar;
